var CryptoJS = require('crypto-js')
ee = {}
ee.a = CryptoJS

function run() {

    var data = ''
    //
    var ne = ee.a.enc.Utf8.parse("efabccee-b754-4c");
    tt =  ee.a.AES.decrypt(data, ne, {
        mode: ee.a.mode.ECB,
        padding: ee.a.pad.Pkcs7
    }).toString(ee.a.enc.Utf8).toString()
    return tt
}

